/// <summary>
/// Customizes the options used to populate the Office Menu.
/// </summary>
/// <param name = "_menuOptions">The menu options to be customized.</param>
public void customizeMenuOptions(OfficeMenuOptions _menuOptions)
{
    List exportOptions = _menuOptions.customMenuItems();

    var exportOption = OfficeGeneratedExportMenuItem::construct(tableStr(InventTransferOrderLineEntity),
                                                                CustomExportLinesToExcelOptionId);
    exportOption.displayName("@SCM:InventTransferOrderLineEntityLabel");
    exportOptions.addEnd(exportOption);

    if (InventTransferOrderLineEnableV2EntityFlight::instance().isEnabled())
    {
        var exportOptionTransferOrderLineEntityV2 = OfficeGeneratedExportMenuItem::construct(tableStr(InventTransferOrderLineV2Entity),
                                                                CustomExportLinesToExcelOptionV2Id);
        exportOptionTransferOrderLineEntityV2.setDisplayNameWithDataEntity();
        exportOptions.addEnd(exportOptionTransferOrderLineEntityV2);

        OfficeMenuDataEntityOptions entityContext = OfficeMenuDataEntityOptions::construct(tableStr(InventTransferOrderLineV2Entity));
        entityContext.includeDefault(false);
        entityContext.dataSourceIdInternal(InventTransferLine_ds.id());
        _menuOptions.dataEntityOptions().addEnd(entityContext);
    }
    else
    {
        OfficeMenuDataEntityOptions entityContext = OfficeMenuDataEntityOptions::construct(tableStr(InventTransferOrderLineEntity));
        entityContext.includeDefault(false);
        entityContext.dataSourceIdInternal(InventTransferLine_ds.id());
        _menuOptions.dataEntityOptions().addEnd(entityContext);
    }

}

public ExportToExcelDataEntityContext getDataEntityContext(OfficeGeneratedExportMenuItem _menuItem)
{
    ExportToExcelDataEntityContext context = null;

    if (_menuItem.id() == CustomExportLinesToExcelOptionId)
    {
        context = ExportToExcelDataEntityContext::construct(tableStr(InventTransferOrderLineEntity), tableFieldGroupStr(InventTransferOrderLineEntity, AutoReport));

        ListEnumerator enumerator = context.entities().getEnumerator();
        while (enumerator.moveNext())
        {
            ExportToExcelDataEntityInfo entity = enumerator.current();

            if (entity.entityName() == tableStr(InventTransferOrderLineEntity))
            {
                ExportToExcelFilterTreeBuilder filterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(InventTransferOrderLineEntity));

                var filter = filterBuilder.and(
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineEntity, DataAreaId), curExt()),
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineEntity, TransferOrderNumber), InventTransferTable.TransferId));

                entity.filter(filter);
            }
        }
    }
    else if (_menuItem.id() == CustomExportLinesToExcelOptionV2Id)
    {
        context = ExportToExcelDataEntityContext::construct(tableStr(InventTransferOrderLineV2Entity), tableFieldGroupStr(InventTransferOrderLineV2Entity, AutoReport));

        ListEnumerator enumerator = context.entities().getEnumerator();
        while (enumerator.moveNext())
        {
            ExportToExcelDataEntityInfo entity = enumerator.current();

            if (entity.entityName() == tableStr(InventTransferOrderLineV2Entity))
            {
                ExportToExcelFilterTreeBuilder filterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(InventTransferOrderLineV2Entity));

                var filter = filterBuilder.and(
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineV2Entity, DataAreaId), curExt()),
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineV2Entity, TransferOrderNumber), InventTransferTable.TransferId));

                entity.filter(filter);
            }
        }
    }

    return context;
}

/// <summary>
/// Gets the set of initial filters to be applied to the template.
/// </summary>
/// <returns>
/// The Map of filters to apply.
/// Keyed by AOT entity name.
/// Values are all Microsoft.Dynamics.Platform.Integration.Office.FilterNode intances.
/// </returns>
/// <remarks>
/// The filters supplied here will override any filters currently in the template.
/// If no filter is suppled for a given entity, any filters currently in the template are retained.
/// </remarks>
public Map getInitialTemplateFilters(OfficeTemplateExportMenuItem _menuItem)
{
    Map filtersToApply = new Map(Types::String, Types::Class);
    if (_menuItem.dataEntityName() == tableStr(InventTransferOrderLineEntity))
    {
        ExportToExcelFilterTreeBuilder filterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(InventTransferOrderLineEntity));

        var filter = filterBuilder.and(
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineEntity, DataAreaId), curExt()),
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineEntity, TransferOrderNumber), InventTransferTable.TransferId));

        filtersToApply.insert(tableStr(InventTransferOrderLineEntity), filter);

        // A record filter has already been applied, do not add one to a specific line
        _menuItem.applyRecordFilter(false);
    }
    else if (_menuItem.dataEntityName() == tableStr(InventTransferOrderLineV2Entity))
    {
        ExportToExcelFilterTreeBuilder filterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(InventTransferOrderLineV2Entity));

        var filter = filterBuilder.and(
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineV2Entity, DataAreaId), curExt()),
                    filterBuilder.areEqual(fieldStr(InventTransferOrderLineV2Entity, TransferOrderNumber), InventTransferTable.TransferId));

        filtersToApply.insert(tableStr(InventTransferOrderLineV2Entity), filter);

        // A record filter has already been applied, do not add one to a specific line
        _menuItem.applyRecordFilter(false);
    }
    return filtersToApply;
}

