void  allowEdit(boolean  _allowEdit)
{

    inventTransferTable_ds.allowEdit(_allowEdit);

    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) || BrazilParameters::isEnabled())
    {
        _allowEdit = true;
    }

    inventTransferLine_ds.allowEdit(_allowEdit);

    if (_allowEdit)
    {
        boolean hasStatusCreated = inventTransferTable.isCreated();
        boolean allowAddressEdit = hasStatusCreated;

        inventTransferLine_ds.allowCreate(hasStatusCreated);
        inventTransferLine_ds.object(fieldNum(InventTransferLine, QtyTransfer)).allowEdit(hasStatusCreated);

        InventParameters    inventParameters    = InventParameters::find();
        boolean             acceptOverDelivery  = inventParameters.InventTransferOverDelivery;
        boolean             acceptUnderDelivery = inventParameters.InventTransferUnderDelivery;

        inventTransferLine_ds.object(fieldNum(InventTransferLine, OverDeliveryPct)).allowEdit(acceptOverDelivery);
        inventTransferLine_ds.object(fieldNum(InventTransferLine, UnderDeliveryPct)).allowEdit(acceptUnderDelivery);

        inventTransferTable_ds.object(fieldNum(InventTransferTable, FromPostalAddress)).allowEdit(allowAddressEdit);
        inventTransferTable_ds.object(fieldNum(InventTransferTable, ToPostalAddress)).allowEdit(allowAddressEdit);

        if (isConfigurationkeyEnabled(configurationKeyNum(Retail)))
        {
            retailAddItemMenuItem.enabled(hasStatusCreated);
        }
    }
}

