private void enableFunctionButtons_BR(InventTransferTable   _inventTransferTable,
                                      boolean               _enableButtonInventTransferShip,
                                      boolean               _enableButtonInventTransferReceive)
{
    boolean enableButtons
        = _inventTransferTable.inventTransferTableFiscalInfo_BR().canCreateShipmentFiscalDocument()
        ||  _inventTransferTable.inventTransferTableFiscalInfo_BR().canCreateReceiveFiscalDocument();

    if (enableButtons)
    {
        enableButtons = _enableButtonInventTransferShip || _enableButtonInventTransferReceive;
    }

    InventTransferFiscalDocumentCancel_BR.enabled(!element.cancelIsNeverAllowed(_inventTransferTable.inventTransferTableFiscalInfo_BR()));

    if (InventTransferFiscalDocumentCancel_BR.isEnabled()
        && _inventTransferTable.TransferStatus != InventTransferStatus::Received
        && InventTransferOrderRegisterItemDisableCancelFlight::instance().isEnabled())
    {
        InventTransferFiscalDocumentCancel_BR.enabled(InventTransferLine::shippedTransferOrderNotExistPickedTransaction(_inventTransferTable.TransferId));
    }

    inventTransferTotals_BR.enabled(enableButtons);
    taxTransSource_BR.enabled(enableButtons);
}

void enableJournalButtons()
{
    InventTransferTable                 localInventTransferTable;
    boolean                             enableButtonInventPickingListJournal;
    boolean                             enableButtonInventTransferJour;

    for (localInventTransferTable = inventTransferTable_ds.getFirst(true) ? inventTransferTable_ds.getFirst(true) as InventTransferTable : inventTransferTable_ds.cursor() as InventTransferTable;
    localInventTransferTable;
    localInventTransferTable = inventTransferTable_ds.getNext() as InventTransferTable)
    {
        if (enableButtonInventPickingListJournal && enableButtonInventTransferJour)
        {
            break;
        }

        if (!enableButtonInventPickingListJournal)
        {
            enableButtonInventPickingListJournal = localInventTransferTable.hasPickingListJournal();
        }

        if (!enableButtonInventTransferJour)
        {
            enableButtonInventTransferJour = localInventTransferTable.hasTransferJournal();
        }
    }

    buttonInventPickingListJournal.enabled(enableButtonInventPickingListJournal);
    buttonInventTransferJour.enabled(enableButtonInventTransferJour);

    if (BrazilParameters::isEnabled())
    {
        this.enableFunctionButtons_BR(inventTransferTable, true, true);
    }
}

void enablePostButtons()
{
    InventTransferTable                 localInventTransferTable;
    boolean                             enableButtonInventPickingListRegistrate;
    boolean                             enableButtonInventTransferShip;
    boolean                             enableButtonInventTransferReceive;
    boolean                             enableButtonAXDSendTransferOrder;
    boolean                             canReleaseOrderForPicking;
    boolean                             atLeastOneTransferOrderHasLines;
    boolean                             atLeastOneTransferOrderHasLinesWithWhsItems;
    boolean                             atLeastOneTransferOrderHasLinesWithTmsItems;

    for (localInventTransferTable = inventTransferTable_ds.getFirst(true) ? inventTransferTable_ds.getFirst(true) as InventTransferTable : inventTransferTable_ds.cursor() as InventTransferTable;
    localInventTransferTable;
    localInventTransferTable = inventTransferTable_ds.getNext() as InventTransferTable)
    {
        if (enableButtonInventPickingListRegistrate
            && enableButtonInventTransferShip
            && canReleaseOrderForPicking
            && atLeastOneTransferOrderHasLines
            && atLeastOneTransferOrderHasLinesWithTmsItems
            && atLeastOneTransferOrderHasLinesWithWhsItems)
        {
            break;
        }

        if (!canReleaseOrderForPicking)
        {
            canReleaseOrderForPicking = localInventTransferTable.canPickingListBeUpdated();
        }

        if (!enableButtonInventPickingListRegistrate)
        {
            enableButtonInventPickingListRegistrate = localInventTransferTable.canPickingListBeRegistered();
        }

        if (!enableButtonInventTransferShip)
        {
            enableButtonInventTransferShip = localInventTransferTable.canShipmentBeUpdated();
        }

        if (!enableButtonInventTransferReceive)
        {
            enableButtonInventTransferReceive = localInventTransferTable.canReceiptBeUpdated();
        }

        if (!atLeastOneTransferOrderHasLines)
        {
            atLeastOneTransferOrderHasLines =  localInventTransferTable.hasLines();
        }

        if (!atLeastOneTransferOrderHasLinesWithWhsItems)
        {
            atLeastOneTransferOrderHasLinesWithWhsItems =  localInventTransferTable.hasLinesWithWhsItem();
        }

        if (!atLeastOneTransferOrderHasLinesWithTmsItems)
        {
            atLeastOneTransferOrderHasLinesWithTmsItems =  localInventTransferTable.hasLinesWithTmsItem();
        }
    }

    buttonInventTransferPick.enabled(canReleaseOrderForPicking);
    buttonInventPickingListRegistrate.enabled(enableButtonInventPickingListRegistrate);
    buttonInventTransferShip.enabled(enableButtonInventTransferShip);
    buttonInventTransferReceive.enabled(enableButtonInventTransferReceive);
    releaseToWarehouse.enabled(canReleaseOrderForPicking);

    btnShipmentDetails.enabled(atLeastOneTransferOrderHasLinesWithWhsItems);
    btnLoadTable.enabled(atLeastOneTransferOrderHasLinesWithTmsItems);

    if (BrazilParameters::isEnabled())
    {
        this.enableFunctionButtons_BR(inventTransferTable, enableButtonInventTransferShip, enableButtonInventTransferReceive);
    }
}

