/// <summary>
/// Disables fields that should not be edited once Route Plan has been selected.
/// </summary>
public void enableTMSFields()
{
    TMSRouteCode                routeCode;
    TMSCarrierCode              carrierCode;
    TMSCarrierGroupCode         carrierGroupCode;
    TMSModeCode                 modeCode;
    boolean                     modeCodeDisabled;

    if (!tmsInventTransferTable.isTmp())
    {
        routeCode           = inventTransferTable.tmsDisplayRoute();
        carrierCode         = tmsInventTransferTable.CarrierCode;
        carrierGroupCode    = tmsInventTransferTable.CarrierGroupCode;
        modeCode            = tmsInventTransferTable.ModeCode;
        modeCodeDisabled    = tmsInventTransferTable.ModeCode != '' && tmsInventTransferTable.CarrierCode == '';

        tmsInventTransferTable_ds.object(fieldNum(TMSInventTransferTable, ModeCode)).allowEdit(!routeCode && !(carrierCode || carrierGroupCode));
        tmsInventTransferTable_ds.object(fieldNum(TMSInventTransferTable, CarrierCode)).allowEdit(!routeCode && !(carrierGroupCode || modeCodeDisabled));
        tmsInventTransferTable_ds.object(fieldNum(TMSInventTransferTable, CarrierServiceCode)).allowEdit(!routeCode && !(carrierGroupCode || modeCodeDisabled));
        tmsInventTransferTable_ds.object(fieldNum(TMSInventTransferTable, CarrierGroupCode)).allowEdit(!routeCode && !(carrierCode || modeCode));

        //This field is displayed when TMS is off - but should then not depend on the tmsDisplayRoute
        inventTransferTable_ds.object(fieldNum(InventTransferTable, DlvModeId)).allowEdit(!routeCode);
    }
}

