    public void init()
    {
        if (#PdsCatchWeightEnabled)
        {
            formCtrl = PmfFormCtrl_InventTransferOrders::constructFromForm(element);
            formCtrl.initPre();
        }

        super();

        // <GIN>
        if (countryRegion_IN)
        {
            element.filterStockTransfer_IN();
            element.design().controlName(DimensionEntryControlLine.name()).visible(true);

            setupLine_IN.visible(true);
            exciseInquiries_IN.visible(true);

            transferType_IN_TransferType_IN.visible(true);

        }
        // </GIN>
        else if (isGTEEnabled)
        {
            inventTransferLine_UnitPrice.visible(true);
            inventTransferLine_NetAmount.visible(true);
        }
        else if (isTaxInTransferOrderEnabled)
        {
            inventTransferLine_UnitPrice.visible(true);
            inventTransferLine_NetAmount.visible(true);
            ShipmentTaxTransSource.visible(true);
            ReceiveTaxTransSource.visible(true);
            ForeignTrade_Listcode.visible(true);
        }

        RelatedSalesOrder.visible(InventTransferLineSalesLineSupplyRelationFeature::isEnabled());

        element.updateDesign(InventDimFormDesignUpdate::Init);

        if (element.args() && element.args().caller() && element.args().caller() is FormRun)
        {
            if (formHasMethod(element.args().caller(), identifierStr(parmItemId)))
            {
                defaultItemId = element.args().caller().parmItemId();
            }

            if (formHasMethod(element.args().caller(), identifierStr(defaultInventDim)))
            {
                defaultInventDim = element.args().caller().defaultInventDim();
            }

            if (formHasMethod(element.args().caller(), identifierStr(getFromDate)))
            {
                defaultDate = element.args().caller().getFromDate();
            }
        }

        if (isConfigurationkeyEnabled(configurationKeyNum(Retail)))
        {
            retailAddItemMenuItem.enabled(inventTransferTable.RecId);
        }

        if (formCtrl)
        {
            formCtrl.setDatasources(inventTransferLine,inventTransferTable);
            formCtrl.initPost();
        }

        logisticsPostalAddressFrom_ds.addFieldToSelectionList(fieldNum(LogisticsPostalAddress, CountryRegionId));
        logisticsPostalAddressTo_ds.addFieldToSelectionList(fieldNum(LogisticsPostalAddress, CountryRegionId));

        if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
