            logisticsPostalAddressLading_RU_ds.addFieldToSelectionList(fieldNum(LogisticsPostalAddress, CountryRegionId));
            logisticsPostalAddressUnlading_RU_ds.addFieldToSelectionList(fieldNum(LogisticsPostalAddress, CountryRegionId));
