        {
            InventTransferLine_ds.object(fieldNum(InventTransferLine, TaxGroupShipment)).visible(true);
            InventTransferLine_ds.object(fieldNum(InventTransferLine, TaxGroupReceipt)).visible(true);
            InventTransferLine_ds.object(fieldNum(InventTransferLine, TaxItemGroupShipment)).visible(true);
            InventTransferLine_ds.object(fieldNum(InventTransferLine, TaxItemGroupReceipt)).visible(true);
            InventTransferLine_ds.object(fieldNum(InventTransferLine, OverrideSalesTaxShipment)).visible(true);
            InventTransferLine_ds.object(fieldNum(InventTransferLine, OverrideSalesTaxReceipt)).visible(true);
        }

		this.design().controlName(formControlStr(InventTransferOrders, WHSLoadTable)).visible(false);
		this.design().controlName(formControlStr(InventTransferOrders, btnLoadTableByTransferLine)).visible(true);
    }

