/// <summary>
/// Updates transportation fields based on the delivery mode.
/// </summary>
/// <param name="_dlvModeId">
/// Delivery mode.
/// </param>
public void tmsSetCarrierFieldsFromDlvMode(DlvModeId _dlvModeId)
{
    TMSCarrierService       carrierService = TMSCarrierService::findByDlvModeId(_dlvModeId);

    tmsInventTransferTable.CarrierCode          = carrierService.CarrierCode;
    tmsInventTransferTable.CarrierServiceCode   = carrierService.CarrierServiceCode;
    tmsInventTransferTable.ModeCode             = TMSCarrier::find(carrierService.CarrierCode).ModeCode;

    tmsInventTransferTable.data(tmsInventTransferTable);
    tmsInventTransferTable_ds.refresh();
}

/// <summary>
/// Updates the transfer order after transportation fields are updated
/// </summary>
public void tmsUpdateTransferOrder()
{
    inventTransferTable.DlvModeId  = TMSCarrierService::findDlvModeId(tmsInventTransferTable.CarrierCode, tmsInventTransferTable.CarrierServiceCode);

    inventTransferTable_ds.refresh();
}

