/// <summary>
/// Update unit price and reaclulate NetAmount
/// </summary>
/// <remarks>Applicable for Transfer orders for Stock transfer type, is not used in stock transfer improvement feature. It seems it is not used at all.</remarks>
public void updateUnitPrice_IN()
{
    if (!InventTransferTable.StockTransferCostPriceHandlingImprovement_IN)
    {
        if (inventTransferLine_IN.PriceType == PriceType_IN::CostPrice)
        {
            inventTransferLine_IN.UnitPrice = inventTransferLine_ds.itemCostPrice_IN();
        }
        else if (inventTransferLine_IN.PriceType == PriceType_IN::TransferPrice)
        {
            inventTransferLine_IN.UnitPrice = inventTransferLine_ds.itemTransferPrice_IN();
            inventTransferLine.QtyTransfer  = inventTransferLine_ds.getTransferPrice_IN().Quantity;
        }

        inventTransferLine_IN.NetAmount = inventTransferLine_IN.UnitPrice * inventTransferLine.QtyTransfer;

        inventTransferLine_IN_ds.refresh();
        inventTransferLine_ds.refresh();
    }
}

/// <summary>
/// Updates inventory dimensions and calls related line logic when dimension information is modified.
/// </summary>
/// <returns>true if the current dimensions settings are not on hold; otherwise false.</returns>
public boolean updateInventDim()
{
    boolean result = true;

    result = inventDim.validateWriteProductDimensions(inventTransferLine.ItemId, false, true);

    if (result)
    {
        inventTransferLine.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;
        result = inventTransferLine.initDataDimensionsModified();
        inventDim.data(InventDim::find(inventTransferLine.InventDimId));
    }

    return result;
}

/// <summary>
/// Determines if expiry date must be checked.
/// </summary>
/// <returns>true if expiry date must be checked; otherwise, false.</returns>
protected boolean mustCheckExpiryDate()
{
    return #PdsShelfEnabled;
}

/// <summary>
/// Updates related inventTransferLines if prompt was confirmed
/// </summary>
/// <returns>
/// A Boolean value indicating whether the update occurred
/// </returns>
protected boolean updateTransferLinesWithPrompt()
{
    if (inventTransferOrders2LineUpdatePrompt)
    {
        inventTransferOrders2LineUpdatePrompt.runOperation();
        inventTransferOrders2LineUpdatePrompt = null;

        return true;
    }

    return false;
}

