/// <summary>
/// Determines whether the transfer type is changed from TransferOrder to StockTransfer having existing transfer lines.
/// </summary>
/// <returns>true if transfer type is changed; otherwise, false.</returns>
private boolean transferTypeChangedToStockTransfer()
{
    return inventTransferTable &&
        inventTransferTable.orig().TransferType_IN == TransferType_IN::TransferOrder &&
        inventTransferTable.TransferType_IN        == TransferType_IN::StockTransfer &&
        inventTransferTable.hasLines();
}

