public boolean validateWrite()
{
    boolean ret;
    SalesCalcAvailableDlvDates salesCalcAvailableDlvDates;

    InventTransferLine  inventTransLineCopy;

    ret = super();

    ret = element.numberSeqFormHandler().formMethodDataSourceValidateWrite(ret) && ret;

    if (ret && inventTransferTable.DeliveryDateControlType != SalesDeliveryDateControlType::None)
    {
        salesCalcAvailableDlvDates = SalesCalcAvailableDlvDates::newCommonSalesDlvDateType(inventTransferTable);
        ret = salesCalcAvailableDlvDates.validateWritePrompt(inventTransferTable);
    }

    if (ret
        && inventTransferTable.hasLines()
        && inventTransferTable.TransferStatus == InventTransferStatus::Created
        && InventTransferOrderHeaderToLineUpdateFeature::isEnabled())
    {
        inventTransferOrders2LineUpdatePrompt =
            InventTransferOrders2LineUpdatePrompt::newFromInventTransferTable(inventTransferTable);

        ret = inventTransferOrders2LineUpdatePrompt.extendedPrompt() && ret;
    }

    // <GIN>
    if (countryRegion_IN)
    {
        if (inventTransferTable.hasLines())
        {
            if (inventTransferTable.orig().TransferType_IN  == TransferType_IN::StockTransfer &&
                inventTransferTable.TransferType_IN         == TransferType_IN::TransferOrder  )
            {
                if (Box::yesNo(strFmt("@GLS5927", "@SYS78234"), DialogButton::No, "@SYS6998") == DialogButton::No)
                {
                    inventTransferTable.TransferType_IN = inventTransferTable.orig().TransferType_IN;
                    inventTransferTable_ds.refresh();
                    throw error("@SYS18447");
                }
            }
            else if (inventTransferTable.orig().TransferType_IN == TransferType_IN::TransferOrder &&
                     inventTransferTable.TransferType_IN        == TransferType_IN::StockTransfer  )
            {
                if (Box::yesNo(strFmt("@SCM:InventTransferOrderTransTypeChangeToStockTransfer", "@GLS5900"), DialogButton::No, "@SYS6998") == DialogButton::No)
                {
                    inventTransferTable.TransferType_IN = TransferType_IN::TransferOrder;
                    inventTransferTable_ds.refresh();
                    throw error("@SYS18447");
                }
            }

            if (ret && inventTransferTable.StockTransferCostPriceHandlingImprovement_IN)
            {
                stockTransferPriceHeader2Line = StockTransferPriceHeader2Line_IN::newExecutePrompt(inventTransferTable);
                if (stockTransferPriceHeader2Line)
                {
                    ret = stockTransferPriceHeader2Line.parmPromptReturnValue();
                }
            }
        }

        if (inventTransferTable.isEditable())
        {
            inventTransferLine_ds.refresh();
        }
    }
    // </GIN>

    return ret;
}

