void write()
{
    TMSInventTransferTable           newTMSInventTransferTable;

    ttsbegin;

    element.numberSeqFormHandler().formMethodDataSourceWrite();

    if (BrazilParameters::isEnabled())
    {
        inventTransferTableFiscalInfo_BR_ds.write();
    }

    boolean doUpdateInventTransferLineItemFieldsByTransferId = countryRegion_IN && inventTransferTable_ds.transferTypeChangedToStockTransfer();

    super();

    if (doUpdateInventTransferLineItemFieldsByTransferId)
    {
        InventTransferLine_IN::updateInventTransferLineItemFieldsByTransferId(inventTransferTable.TransferId);
    }
    else if (stockTransferPriceHeader2Line)
    {
        stockTransferPriceHeader2Line.runOperation();
    }

    if (BrazilParameters::isEnabled())
    {
        inventTransferTableFiscalInfo_BR.SysExtensionSerializerExtensionMap::insertAfterBaseTable(inventTransferTable);
    }

    if (!tmsInventTransferTable.isTmp()) // No need to query for TMSInventTransferTable if it is disabled
    {
        newTMSInventTransferTable = TMSInventTransferTable::find(inventTransferTable.TransferId);

        tmsInventTransferTable.data(newTMSInventTransferTable);
        tmsInventTransferTable.reread();
    }

    element.updateTransferLinesWithPrompt();

    element.enableButtons();

    ttscommit;

    if (doUpdateInventTransferLineItemFieldsByTransferId)
    {
        InventTransferLine_ds.research();
    }
}

