public boolean validateWrite()
{
    boolean ret;
    SalesCalcAvailableDlvDates salesCalcAvailableDlvDates;

    ret = super();

    if (ret && inventTransferLine.DeliveryDateControlType != SalesDeliveryDateControlType::None)
    {
        salesCalcAvailableDlvDates = SalesCalcAvailableDlvDates::newCommonSalesDlvDateType(inventTransferLine);
        ret = salesCalcAvailableDlvDates.validateWritePrompt(inventTransferLine);
    }

    inventTransferLine.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;
    if (ret && !bufCmp(inventDim, inventDim.orig()))
    {
        // If the line is for a WHS item on WHS warehouse, and the inventDim has changed,
        // we need to check that no dimensions below location were specified
        // and warn the user if they have, but do not fail the line validation
        if (ret
            && WHSInventEnabled::exist(inventTransferLine.ItemId)
            && inventDim.InventLocationId
            && inventDim.inventLocation().whsEnabled
            && WHSReservationHierarchyInventDimUtil::isLocationOrBelowSpecified(InventTable::find(inventTransferLine.ItemId), inventDim))
        {
            warning ("@WAX5690");
        }
    }

    ret = ret && InventMovement::setAutoReserving(inventTransferLine);

    return ret;
}

int active()
{
    int     ret;
    boolean isWhsOrTmsEnabled;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    if (formCtrl)
    {
        formCtrl.dataSourceActivePost();
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(Retail)))
    {
        // Disable shipping if the source warehouse is not available for the current user
        if (InventLocation::find(inventTransferTable.InventLocationIdFrom).RecId == 0)
        {
            inventTransferLine_ds.object(fieldNum(InventTransferLine, QtyShipNow)).allowEdit(false);
        }

        // Disable receiving if the target warehouse is not available for the current user
        if (InventLocation::find(inventTransferTable.InventLocationIdTo).RecId == 0)
        {
            inventTransferLine_ds.object(fieldNum(InventTransferLine, QtyReceiveNow)).allowEdit(false);
        }
    }

    inventTransferUpdateRemain.enabled((inventTransferLine_ds.cursor() ? true : false) && inventTransferLine.QtyRemainShip);

    isWhsOrTmsEnabled = WHSInventEnabled::exist(inventTransferLine.ItemId) || TMSInventEnabled::exist(inventTransferLine.ItemId);
    whsInventTransferLine_PackingQty.enabled(isWhsOrTmsEnabled);
    crossDock.enabled(isWhsOrTmsEnabled);

    if (isTaxInTransferOrderEnabled)
    {
        inventTransferLine_ds.object(fieldNum(InventTransferLine, TaxGroupShipment)).allowEdit(inventTransferLine.OverrideSalesTaxShipment == NoYes::Yes);
        inventTransferLine_ds.object(fieldNum(InventTransferLine, TaxItemGroupShipment)).allowEdit(inventTransferLine.OverrideSalesTaxShipment == NoYes::Yes);
        inventTransferLine_ds.object(fieldNum(InventTransferLine, TaxGroupReceipt)).allowEdit(inventTransferLine.OverrideSalesTaxReceipt == NoYes::Yes);
        inventTransferLine_ds.object(fieldNum(InventTransferLine, TaxItemGroupReceipt)).allowEdit(inventTransferLine.OverrideSalesTaxReceipt == NoYes::Yes);
    }

    return ret;
}

void write()
{
    WHSInventTransferLine newWHSInventTransferLine;
    boolean countryRegion_RU = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]);

    if (formCtrl)
    {
        formCtrl.dataSourceWritePre();
    }

    inventTransferLine.InventDimId    = InventDim::findOrCreate(inventDim).InventDimId;

    InventMovement::bufferSetRemainQty(inventTransferLine,InventMovSubType::None);
    InventMovement::bufferSetRemainQty(inventTransferLine,InventMovSubType::TransferOrderTransitFrom);

    ttsbegin;

    if (countryRegion_RU)
    {
        inventTransferLine.InventDimIdTo_RU = InventDim::findOrCreate(inventDimTo_RU).InventDimId;
    }

    if (BrazilParameters::isEnabled())
    {
        inventTransferLineFiscalInfo_BR_ds.write();
    }

    super();

    if (inventTransferLine_IN_ds.isNeeded())
    {
        inventTransferLine_IN.InventTransferLine = inventTransferLine.RecId;

        if (inventTransferLine_IN.validateWrite())
        {
            inventTransferLine_IN.write();
        }
    }

    if (inventTransferLine.InventDimId != inventDim.InventDimId)
    {
        inventDim.data(InventDim::find(inventTransferLine.InventDimId));
        inventDim_ds.setCurrent();
    }

    if (countryRegion_RU)
    {
        inventDimTo_RU.data(InventDim::find(inventTransferLine.InventDimIdTo_RU));
        inventDimTo_RU_ds.setCurrent();
    }

    //transferTable status might have been updated
    if (!inventTransferLine.QtyRemainReceive || !inventTransferLine.QtyRemainShip)
    {
        inventTransferTable_ds.reread();
        inventTransferTable_ds.refresh();
        element.allowEdit(inventTransferTable.isEditable());
    }

    if (BrazilParameters::isEnabled())
    {
        inventTransferLineFiscalInfo_BR.SysExtensionSerializerExtensionMap::insertAfterBaseTable(inventTransferLine);

        inventTransferTable_ds.reread();
        inventTransferTable_ds.refresh();
    }

    if (WHSInventEnabled::exist(inventTransferLine.ItemId) || TMSInventEnabled::exist(inventTransferLine.ItemId))
    {
        newWHSInventTransferLine = WHSInventTransferLine::find(inventTransferLine.RecId, true);

        if (newWHSInventTransferLine)
        {
            newWHSInventTransferLine.CrossDock = whsInventTransferLine.CrossDock;
            newWHSInventTransferLine.update();
        }
    }

    ttscommit;

    // <GIN>
    if (countryRegion_IN && !InventTransferTable.StockTransferCostPriceHandlingImprovement_IN)
    {
        inventTransferLine_ds.research();
    }
    // </GIN>

    element.enableButtons();
}

/// <summary>
/// Get Transfer price for transfer line converted accoroding Transfer line unit and Currency code.
/// </summary>
/// <returns>Transfer price for transfer line converted accroding Transfer line unit</returns>
/// <remarks>Applicable for Transfer orders for Stock transfer type, is not used in stock transfer improvement feature. It seems it is not used at all.</remarks>
public real itemTransferPrice_IN()
{
    PriceCur                  itemPrice;
    if (!InventTransferTable.StockTransferCostPriceHandlingImprovement_IN)
    {
        TransferPrice_IN          transPrice;
        CostPrice                 costPrice;
        ExchRate                  exchRate;
        UnitOfMeasureSymbol       unitIDFrom;
        Price                     transferPrice;
        CurrencyCode              currencyCode;
        ExchangeRateType          exchangeRateType;
        ExchangeRateTypeRecId     exchangeRateTypeRecId;
        ExchangeRateDisplayFactor exchangeRateDisplayFactor;

        transPrice    = inventTransferLine_ds.getTransferPrice_IN();
        transferPrice = transPrice.Price;

        if (transPrice)
        {
            EcoResProductUnitConverter unitConverter;

            unitIDFrom = transPrice.Unit;
            //Round by currency, instead of rounding by unit.
            if (InventTransferOrdersFixRoundTransferPrice_INFlight::instance().isEnabled())
            {
                unitConverter = EcoResProductUnitConverter::newGivenUnitSymbolsForReleasedProduct(
                    inventTransferLine.ItemId,
                    inventTransferLine.InventDimId,
                    unitIDFrom,
                    inventTransferLine_IN.UnitId,
                    NoYes::No,
                    NoYes::No);
            }
            else
            {
                unitConverter = EcoResProductUnitConverter::newGivenUnitSymbolsForReleasedProduct(
                    inventTransferLine.ItemId,
                    inventTransferLine.InventDimId,
                    unitIDFrom,
                    inventTransferLine_IN.UnitId);
            }

            if (!unitConverter.canValueBeConverted())
            {
                throw error(strFmt("@SYS28690", unitIDFrom, inventTransferLine_IN.UnitId));
            }

            costPrice = inventTransferLine_ds.itemCostPrice_IN();
            exchRate  = 1;

            if (transPrice && transPrice.Currency != Ledger::accountingCurrency())
            {
                currencyCode = Ledger::accountingCurrency();

                exchangeRateTypeRecId = Ledger::defaultExchangeRateType(CompanyInfo::findDataArea(curext()).RecId);

                exchangeRateType = ExchangeRateType::find(exchangeRateTypeRecId);

                exchangeRateDisplayFactor = ExchangeRateCurrencyPair::getExchangeRateDisplayFactor(transPrice.Currency, currencyCode, exchangeRateType.RecId, true);

                exchRate = ExchangeRateHelper::exchRate(transPrice.Currency) / InventTransferLine::getNumericDisplayFactor(exchangeRateDisplayFactor);

                inventTransferLine_IN.CurrencyCode = transPrice.Currency;
            }

            if (transPrice.MethodPriceTrans_IN == MethodPriceTrans_IN::FixedPrice)
            {
                itemPrice = transferPrice * exchRate;
            }
            else if (transPrice.MethodPriceTrans_IN == MethodPriceTrans_IN::CostPlus)
            {
                itemPrice = (costPrice + (costPrice * transferPrice / 100)) * exchRate ;
            }
            //Round by currency, instead of rounding by unit.
            if (InventTransferOrdersFixRoundTransferPrice_INFlight::instance().isEnabled())
            {
                //Convert price by unit first without rounding. Then do rounding per currency.
                itemPrice = unitConverter.convertValue(itemPrice);
                itemPrice = CurrencyExchangeHelper::price(itemPrice, inventTransferLine_IN.CurrencyCode);
            }
            else
            {
                itemPrice = CurrencyExchangeHelper::price(itemPrice, inventTransferLine_IN.CurrencyCode);
                itemPrice = unitConverter.convertValue(itemPrice);
            }
        }
    }
    return itemPrice;
}

/// <summary>
/// Get Transfer price for transfer line.
/// </summary>
/// <returns>Transfer price for transfer line</returns>
/// <remarks>Applicable for Transfer orders for Stock transfer type, is not used in stock transfer improvement feature.</remarks>
public TransferPrice_IN  getTransferPrice_IN()
{
    return TransferPrice_IN::getTransferPrice_IN(inventTransferLine.TransferId,
                                                 inventTransferLine.ItemId,
                                                 inventTransferLine.InventDimId,
                                                 inventDim);
}

/// <summary>
/// Get Transfer price for transfer line converted accroding Transfer line unit.
/// </summary>
/// <returns>Transfer price for transfer line converted accroding Transfer line unit</returns>
/// <remarks>Applicable for Transfer orders for Stock transfer type, is not used in stock transfer improvement feature. It seems it is not used at all.</remarks>
public real getUnitPrice_IN()
{
    real                transferPrice;
    UnitOfMeasureSymbol unitIDFrom;
    TransferPrice_IN    transPrice;

    transPrice = inventTransferLine_ds.getTransferPrice_IN();

    transferPrice = inventTransferLine_IN.UnitPrice;
    unitIDFrom    = transPrice.Unit;

    if (unitIDFrom != inventTransferLine_IN.UnitId)
    {
        if (!EcoResProductUnitConverter::canBeConvertedGivenUnitSymbolsForReleasedProduct(inventTransferLine.ItemId,
                                                                                          inventTransferLine.InventDimId,
                                                                                          unitIDFrom,
                                                                                          inventTransferLine_IN.UnitId))
        {
            throw error(strFmt("@SYS28690", unitIDFrom, inventTransferLine_IN.UnitId));
        }

        transferPrice = (transferPrice * (UnitOfMeasureConversion::findByConversion(UnitOfMeasure::unitOfMeasureIdBySymbol(unitIDFrom),
                                                                  UnitOfMeasure::unitOfMeasureIdBySymbol(inventTransferLine_IN.UnitId),
                                                                  InventTable::itemProduct(inventTransferLine.ItemId)).Factor));
    }

    return transferPrice;
}

/// <summary>
/// Calculates unit price of Cost price tye and update releated valuse in Transfer line.
/// </summary>
/// <param name = "_inventTransLine">Cursor of Invent tranfer line type</param>
/// <param name = "_inventDim">Cursor of Inventory dimension type</param>
/// <remarks>Applicable for Transfer orders of Stock transfer type, used after InventDim field modifying, is not used in stock transfer improvement feature.</remarks>
public void createDimPrice_IN(InventTransferLine    _inventTransLine,
                              InventDim             _inventDim)
{
    if (!InventTransferTable.StockTransferCostPriceHandlingImprovement_IN)
    {
        InventTransferLine  inventTransLine = _inventTransLine;

        if (inventTransferLine_IN.PriceType == PriceType_IN::CostPrice &&
            InventTransferTable::find(inventTransLine.TransferId).TransferType_IN == TransferType_IN::StockTransfer)
        {
            using (InventTransferLineInventSumUnitPriceContext_IN context = InventTransferLineInventSumUnitPriceContext_IN::construct())
            {
                context.parmInventDim(_inventDim);
                inventTransferLine_IN.UnitPrice = inventTransLine.inventSumUnitPrice_IN();
            }
            inventTransferLine_IN.NetAmount                          = inventTransferLine_IN.UnitPrice * inventTransLine.QtyTransfer;
            inventTransferLine_IN.AssessableValueTransactionCurrency = inventTransferLine_IN.NetAmount;
            inventTransferLine_IN.MaximumRetailPrice                 = inventTransferLine_IN.NetAmount;

