public void calcInventTax_IN()
{
    FormRun                 callerFormRun;
    Tax                     inventTax;
    InventTransLineTax_IN   inventLineTax;
    InventTransferTable     inventTransTableLoc;

    inventTransTableLoc = InventTransferTable::find(inventTransferLine.TransferId, false);
    inventLineTax       = InventTransLineTax_IN::construct(inventTransTableLoc);

    if (inventTransTableLoc.TransferType_IN == TransferType_IN::StockTransfer &&
        inventTransTableLoc.TransferStatus  != InventTransferStatus::Received )
    {
        inventLineTax.calc();
        inventLineTax.sourceSingleLine(true, true);
        Tax::showTaxes(menuitemDisplayStr(TaxTmpWorkTransferOrder_IN), inventLineTax, inventTransferLine, callerFormRun);
    }
    else
    {
        inventTax           = new Tax();
        Tax::showTaxes(menuitemDisplayStr(TaxTmpWorkTransferOrder_IN), inventTax, null, callerFormRun);
    }
}

public void calcInventTaxNoShow_IN()
{
    Tax                     inventTax;
    InventTransLineTax_IN   inventLineTax;
    InventTransLineTax_IN   inventLineTaxLoc;
    InventTransferTable     inventTransTableLoc;

    TaxTmpWorkTransForm     taxTmpWorkTransForm;
    TmpTaxRegulation        tmpTaxRegulation;
    TmpTaxWorkTrans         tmpTaxWorkTrans;

    inventTax           = new Tax();
    inventTransTableLoc = InventTransferTable::find(inventTransferLine.TransferId, false);
    inventLineTax       = InventTransLineTax_IN::construct(inventTransTableLoc);

    if (inventTransTableLoc.TransferType_IN == TransferType_IN::StockTransfer &&
        inventTransTableLoc.TransferStatus  != InventTransferStatus::Received )
    {
        inventLineTax.calc();
    }
    else
    {
        inventLineTaxLoc = InventTransLineTax_IN::construct(null);
    }

    taxTmpWorkTransForm = new TaxTmpWorkTransForm();
    taxTmpWorkTransForm.parmTaxObject(inventLineTax);
    taxTmpWorkTransForm.initTax(inventLineTax, tableNum(InventTransferLine), inventTransferLine_ds.cursor(), tmpTaxRegulation, tmpTaxWorkTrans);
}

