public boolean validateDelete()
{
    boolean ret = true;

    if (InventTransferLineSalesLineSupplyRelationFeature::isEnabled())
    {
        InventTransferOrderSalesLineSupplyRelation relation;
        select firstonly RecId, SalesId from relation
        where relation.TransferId      == inventTransferLine.TransferId
           && relation.TransferLineNum == inventTransferLine.LineNum;

        if (relation.RecId)
        {
            str warning = strFmt("@SCM:InventTranferLineDeleteCheckSupplyRelationWarning", inventTransferLine.ItemId, inventTransferLine.LineNum, relation.SalesId, relation.salesLine().LineNum);
            ret = (Box::YesNo(warning, DialogButton::No) == DialogButton::Yes) && inventTransferLine.validateDelete();
        }
        else
        {
            ret = super();
        }
    }
    else
    {
        ret = super();
    }

    return ret;
}

