void modified()
{
    super();

    if (WHSInventEnabled::exist(inventTransferLine.ItemId) || TMSInventEnabled::exist(inventTransferLine.ItemId))
    {
        // Default Status
        whsInventTransferLine.PackingQty = WHSInventTable::getDefaultPackingQty(inventTransferLine.ItemId, inventTransferLine.InventDimId);
        crossDock.enabled(true);
    }
    else
    {
        crossDock.enabled(false);
    }

    element.updateItemId();

    if (formCtrl)
    {
        formCtrl.fieldModified(fieldNum(InventTransferLine,ItemId));
    }

    // <GIN>
    if (countryRegion_IN)
    {
        if (InventTransferTable.TransferType_IN == TransferType_IN::StockTransfer)
        {
            InventDim::find(InventTransferLine.InventDimId).modifiedInventSiteFromParent(inventTransferLine_IN);

            inventTransferLine_IN_ds.refresh();
        }
    }
    // </GIN>

    else if (isGTEEnabled || isTaxInTransferOrderEnabled)
    {
        inventTransferLine.UnitPrice       = inventTransferLine_ds.itemCostPrice();
        inventTransferLine.NetAmount       = inventTransferLine.netAmount(inventTransferLine);
        inventTransferLine.setStatisticalAmounts();

        inventTransferLine_DS.refresh();
    }

    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        inventDimTo_RU.data(InventDim::find(inventTransferLine.InventDimIdTo_RU));
    }

    if (BrazilParameters::isEnabled())
    {
        this.setDefaultCFOP_BR();
    }
}

