public boolean validate()
{
    InventTransferLine otherTransferLine;
    boolean ret;

    ret = super();

    if (inventTransferLine.QtyTransfer < inventTransferLine.orig().QtyTransfer
        && (inventTransferLine.QtyRemainShip    - inventTransferLine.QtyTransfer == 0
        ||  inventTransferLine.QtyRemainReceive - inventTransferLine.QtyTransfer == 0))
    {
        select firstonly RecId from otherTransferLine
            where otherTransferLine.TransferId   == inventTransferLine.TransferId
            &&    otherTransferLine.RemainStatus != InventTransferRemainStatus::None
            &&    otherTransferLine.RecId        != inventTransferLine.RecId;

        if (!otherTransferLine.RecId && !Box::yesNo(strFmtLB(strFmt("@SYS106908",
                                fieldId2pname(tableNum(InventTransferLine),fieldNum(InventTransferLine,QtyTransfer)),
                                ((inventTransferLine.QtyRemainReceive - inventTransferLine.QtyTransfer == 0) ? enum2str(InventTransferStatus::Received) : enum2str(InventTransferStatus::Shipped)))),
                                DialogButton::Yes,
                                "@SYS78234"))
        {
            ret = false;
        }
    }

    return ret;
}

