/// <summary>
///    Persists a record in the database when super is called.
/// </summary>
/// <remarks>
/// Some invent transfer table records don't have a corresponding tms invent transfer table record
/// so call write method and not super and it will update database properly
/// </remarks>
public void write()
{
    if (!tmsInventTransferTable.isTmp())
    {
        if (tmsInventTransferTable.RecId == 0)
        {
            tmsInventTransferTable.initFromInventTransferId(inventTransferTable.TransferId);
        }

        tmsInventTransferTable.write();
    }
}

public int active()
{
    int ret;

    ret = super();

    element.enableTMSFields();

    return ret;
}

/// <summary>
/// Determines whether the current record is valid and ready to be written to the database.
/// </summary>
/// <returns>
/// true if the record is valid; otherwise, false.
/// </returns>
/// <remarks>
/// Some invent transfer table records don't have a corresponding tms invent transfer table record
/// so call super only if corresponding record exists
/// </remarks>
public boolean validateWrite()
{
    boolean ret = true;

    if (tmsInventTransferTable.CarrierCode != "" && tmsInventTransferTable.CarrierServiceCode == "")
    {
        throw error("@TRX733");
    }

    if (tmsInventTransferTable.CarrierCode && tmsInventTransferTable.CarrierServiceCode)
    {
        if (!TMSCarrierService::exist(tmsInventTransferTable.CarrierServiceCode, tmsInventTransferTable.CarrierCode))
        {
            throw error("@TRX734");
        }
    }

    if (tmsInventTransferTable.RecId != 0)
    {
        ret = super();
    }

    return ret;
}

public void modified()
{
    if (tmsInventTransferTable.RecId == 0)
    {
        tmsInventTransferTable.initFromInventTransferId(inventTransferTable.TransferId);
    }

    super();

    tmsInventTransferTable.ModeCode  = TMSCarrier::find(tmsInventTransferTable.CarrierCode).ModeCode;

    if (!tmsInventTransferTable.CarrierCode
    || !TMSCarrierService::exist(tmsInventTransferTable.CarrierServiceCode, tmsInventTransferTable.CarrierCode))
    {
        tmsInventTransferTable.CarrierServiceCode    = "";
    }

    tmsInventTransferTable_ds.refresh();

    element.tmsUpdateTransferOrder();

    element.enableTMSFields();
}

