public void modified()
{
    super();

    if (!InventTransferTable.StockTransferCostPriceHandlingImprovement_IN) 
    {
        if (!inventTransferLine.checkCostPrice_IN())
        {
            element.updateUnitPrice_IN();
        }
        else if (inventTransferLine_IN.PriceType == PriceType_IN::TransferPrice)
        {
            element.updateUnitPrice_IN();
        }
        inventTransferLine_IN.AssessableValueTransactionCurrency = inventTransferLine_IN.NetAmount;
    }
    inventTransferLine_IN.vatPriceType    = inventTransferLine_IN.PriceType;
}

public void modified()
{
    super();

    if (inventTransferLine_IN.orig().UnitPrice != inventTransferLine_IN.UnitPrice)
    {
        inventTransferLine_IN.NetAmount = inventTransferLine_IN.netAmount(inventTransferLine);
    }

    if (inventTransferLine_IN.UnitPrice == 0)
    {
        inventTransferLine_IN.NetAmount = 0;
    }

    inventTransferLine_IN.AssessableValueTransactionCurrency = inventTransferLine_IN.NetAmount;
}

public void lookup(FormControl  _formControl, str   _filterStr)
{
    SysTableLookup          sysTableLookup;
    Query                   query = new Query();
    QueryBuildDataSource    queryBuildDataSource;
    QueryBuildRange         queryBuildRange;

    sysTableLookup          = SysTableLookup::newParameters(tableNum(TaxTable), _formControl);
    queryBuildDataSource    = query.addDataSource(tableNum(TaxTable));
    queryBuildRange         = queryBuildDataSource.addRange(fieldNum(TaxTable, TaxType_IN));
    queryBuildRange.value(queryValue(TaxType_IN::VAT));
    sysTableLookup.addLookupfield(fieldNum(TaxTable, TaxCode));
    sysTableLookup.addLookupfield(fieldNum(TaxTable, TaxName));
    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

