{
    if (BrazilParameters::isEnabled() && inventTransferTableFiscalInfo_BR.InventTransferTable)
    {
        // no-op because a record with an empty FK is not valid
        super();
    }
}

public void enableControls(boolean _allowEdit)
{
    boolean createShipmentFiscalDocument    = inventTransferTableFiscalInfo_BR.canCreateShipmentFiscalDocument();
    boolean createReceiveFiscalDocument     = inventTransferTableFiscalInfo_BR.canCreateReceiveFiscalDocument();
    boolean allowFiscalInfoEdit             = inventTransferTable.isCreated();

    inventTransferTableFiscalInfo_BR_ds    .allowEdit(_allowEdit && createShipmentFiscalDocument && allowFiscalInfoEdit);

    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ReceiveCFOPTable_BR))  .allowEdit(_allowEdit && createReceiveFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ReceivePrice))         .allowEdit(_allowEdit && createReceiveFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ReceiveTaxGroup))      .allowEdit(_allowEdit && createReceiveFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ReceiveTaxItemGroup))  .allowEdit(_allowEdit && createReceiveFiscalDocument);

    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ShipCFOPTable_BR))     .allowEdit(_allowEdit && createShipmentFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ShipPrice))            .allowEdit(_allowEdit && createShipmentFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ShipTaxGroup))         .allowEdit(_allowEdit && createShipmentFiscalDocument);
    inventTransferLineFiscalInfo_BR_ds.object(fieldNum(InventTransferLineFiscalInfo_BR, ShipTaxItemGroup))     .allowEdit(_allowEdit && createShipmentFiscalDocument);

    table_FiscalDocumentText_BR.enabled(createShipmentFiscalDocument || createReceiveFiscalDocument);
    line_FiscalDocumentText_BR.enabled(createShipmentFiscalDocument || createReceiveFiscalDocument);
}

