    InventTransferTotals_BR::showTax(menuitemDisplayStr(TaxTmpWorkTransferOrder_IN), inventTransferTable);
}

public void clicked()
{
    this.parameters(classStr(TaxableDocumentDescriptorInventTransferOrder));
    super();
}

void clicked()
{
    Args                args = new Args();
    InventTransferJour  inventTransferJour;
    InventTransferJour  localInventTransferJour;
    super();
    select firstonly inventTransferJour
        where inventTransferJour.TransferId == inventTransferTable.TransferId;

    if (inventTransferJour)
    {
        while select localInventTransferJour
                order by CreatedDateTime
                    where localInventTransferJour.TransferId == inventTransferJour.TransferId &&
                          localInventTransferJour.UpdateType == InventTransferUpdateType::Shipment
        {
            args.record(localInventTransferJour);
            new MenuFunction(menuitemOutputStr(InventTransferOrderPackingSlip_LT), MenuItemType::Output).run(args);
        }
    }
    else
    {
        args.record(inventTransferTable);
        new MenuFunction(menuitemOutputStr(InventTransferOrderPackingSlipPro_LT), MenuItemType::Output).run(args);
    }
}

