    super();
}

public boolean modified()
{
    boolean      ret;

    ret = super();

    // <GBR>
    if (ret && BrazilParameters::isEnabled() && tmsInventTransferTable.CarrierCode)
    {
        inventTransferTableFiscalInfo_BR.initSalesCarrierFromTmsCarrier(tmsInventTransferTable.CarrierCode);
        inventTransferTableFiscalInfo_BR_ds.refresh();
    }
    // </GBR>

    return ret;
}

